import React, { Component } from "react";
import "./styles.scss";

class Cart extends Component {
  render() {
    return (
      <>
        <div className="row">
          <div className="col-2">
            <div className="compare-title text-white">
              <h2>Compare</h2>
              <div className="amount-product">2 product(s)</div>
            </div>
          </div>
          <div className="col-6"></div>
          <div className="col-3"></div>
        </div>
      </>
    );
  }
}

export default Cart;
